import React from 'react';
import google from '../../images/icons/google.png';
import facebook from '../../images/icons/facebook.png';

const SocialButtons = () => {
    const btnStyle = {
        padding: "5px 10px"
    };

    return (
        <React.Fragment>
            <div className="row">
                <div className="col-md-6">
                    <button type="button" className="btn btn-outline-light d-flex align-items-center">
                        <img src={google} alt="google" width="30" height="30" className="mr-2" />
                        Continue with Google
                    </button>
                </div>
                <div className="col-md-6">
                    <button type="button" className="btn btn-primary d-flex align-items-center">
                        <img src={facebook} alt="facebook" width="30" height="30" className='mr-2' />
                        Continue with Facebook
                    </button>
                </div>
                <div className="col-md-6">
                    <button type="button" className="btn btn-primary d-flex align-items-center">
                        <img src={google} alt="google" width="30" height="30" className="mr-2" />
                        Continue with Twitter
                    </button>
                </div>
                <div className="col-md-6">
                    <button type="button" className="btn btn-primary d-flex align-items-center">
                        <img src={facebook} alt="facebook" width="30" height="30" className='mr-2' />
                        Continue with Instagram
                    </button>
                </div>
            </div>
        </React.Fragment>
    );
}

export default SocialButtons;
